.dummy {
  color: #ffffff;
  position: absolute;
  top: 0;
  opacity: 0;
  z-index: -1;
}

.dummy p {
  opacity: 1;
}

.dummy p:nth-child(1) {
  font-family: "condensedsemibold";
}

.dummy p:nth-child(2) {
  font-family: "condensedextrabold";
}

.dummy p:nth-child(3) {
  font-family: "semibold";
}

/* Camera Flash Effect */
@keyframes cameraFlash {
  0% {
    opacity: 0; /* Start invisible */
  }
  25% {
    opacity: 1; /* Bright flash */
  }
  100% {
    opacity: 0; /* Fade out completely */
  }
}

.camera-flash {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: white; /* Bright white for the flash */
  opacity: 0; /* Default state invisible */
  z-index: 9999; /* Ensure it appears above all other elements */
  animation: cameraFlash 1s ease-in-out forwards; /* Trigger animation */
}
      body {
        overflow: hidden;
      }

      #app {
        overflow: hidden;
        position: fixed !important;
        height: 100%;
        width: auto;
        left: 0;
        right: 0;
        margin: auto;
      }

      #openWindowButton {
        position: fixed !important;
        height: 100%;
        width: auto;
        left: 0;
        right: 0;
        margin: auto;
        width: 0;
        height: 0;
        opacity: 0;
      }

      .button-container {
        display: flex;
        justify-content: center;
        align-items: center;
        margin-top: 50px;
        top: 120%;
        transition: all 1s;
        position: absolute;
        left: 0;
        right: 0;
        margin: auto;
        width: 300px;
      }

      .button-container:hover {
        transform: scale(
          1.1
        ); /* (150% zoom - Note: if the zoom is too large, it will go outside of the viewport) */
      }

      .custom-button {
        display: inline-flex;
        align-items: center;
        justify-content: space-between;
        padding: 16px 24px;
        font-family: Arial, sans-serif;
        font-size: 18px;
        font-weight: bold;
        color: #333; /* Text color */
        background-color: #ffffff; /* Green background */
        border: none;
        border-radius: 0 12px 12px 12px; /* Rounded corners */
        text-decoration: none; /* Remove underline */
        transition: background-color 0.3s, box-shadow 0.3s;
      }

      .custom-button .arrow {
        display: inline-block;
        margin-left: 10px;
        width: 10px;
        height: 10px;
        border-right: 3px solid #333; /* Arrow color */
        border-top: 3px solid #333; /* Arrow color */
        transform: rotate(45deg); /* Create arrow shape */
      }

      .custom-button:hover {
        background-color: #a3d962; /* Slightly darker green on hover */
        box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2); /* Add a subtle shadow */
      }
